import { createContext, useContext } from 'react'

const theme = {
    primary: 'red',
    secondary: 'blue'
}

export const ThemeContext = createContext(theme)

const ThemeProvider = (props) => {
    return (
    <ThemeContext.Provider theme={theme}>
        {props.children}
    </ThemeContext.Provider>
    )
}

export default ThemeProvider
